// Expand compact format to full definitions
const actionDefinitions: Record<string, ActionDefinition> = {};
for (const [id, [title, colorCode, icon]] of Object.entries(compact)) {
  actionDefinitions[id] = { title, background: colorMap[colorCode], icon };
}

/**
 * Get action definition with fallback for unknown actions
 */
export function getActionDefinition(identifier: string): ActionDefinition {
  const definition = actionDefinitions[identifier];

  if (definition) {
    return definition;
  }

  // Fallback for unknown actions - extract name from identifier
  const name = identifier.replace('is.workflow.actions.', '');
  const formattedName = name
    .split('.')
    .map((part) => part.charAt(0).toUpperCase() + part.slice(1))
    .join(' ');

  return {
    title: formattedName || 'Unknown Action',
    background: 'Gray',
  };
}

/**
 * Check if an action has a custom renderer
 */
export function hasCustomRenderer(identifier: string): boolean {
  return !!actionDefinitions[identifier]?.Component;
}

/**
 * Get all registered action identifiers
 */
export function getAllActionIdentifiers(): string[] {
  return Object.keys(actionDefinitions);
}
